  `remarks` varchar(255) DEFAULT NULL,
  `select_member` varchar(255) DEFAULT NULL,
  `select_position` varchar(255) DEFAULT NULL,
  `sms_send` varchar(255) DEFAULT NULL,
  `state` varchar(255) DEFAULT NULL,
  `member_id` int(11) NOT NULL,
  `jr_position` varchar(255) DEFAULT NULL,
  `immidiate_jr` varchar(255) DEFAULT NULL,
  `immidiate_sr` varchar(255) DEFAULT NULL,
