  `flag` varchar(20) DEFAULT '1',
  `created_by` varchar(255) DEFAULT NULL,
  `created_dt` varchar(255) DEFAULT NULL,
  `f_date` varchar(255) DEFAULT NULL,
  `t_date` varchar(255) DEFAULT NULL,
  PRIMARY KEY (`id`)
